import React, { Component } from 'react';
import MainEmployeeForm from '../../../../components/Forms/EmployeeForms/EmployeeForm';

export default class EmployeeForm extends Component {
   render() {
      const {
         onChange,
         onSubmit,
         onClear,
         sap,
         name,
         email,
         role,
         supportType,
         project,
         mainlanguage,
         rm
      } = this.props;
      return (
         <MainEmployeeForm
            onChange={onChange}
            onSubmit={onSubmit}
            onClear={onClear}
            sap={sap}
            name={name}
            email={email}
            role={role}
            supportType={supportType}
            project={project}
            mainlanguage={mainlanguage}
            rm={rm}
         />
      );
   }
}
